import { Route, Switch } from "react-router";
import AllMeetUps from "./pages/AllMeetups";
import NewMeetups from "./pages/NewMeetup";


function App() {
  return (
    <div>
      <Switch>
        <Route path="/">
          <AllMeetUps></AllMeetUps>
        </Route>
       <Route path='/new-meetup'>
         <NewMeetups></NewMeetups>
         </Route> 
      </Switch>
    </div>
  );
}

export default App;
